uint32_t getNow() { return QTime::currentTime().msecsSinceStartOfDay(); }

void saveData(uint8_t *d, int size)
{
    QFile f("settings"); f.open(QIODevice::WriteOnly); f.write((char*)d, size);
}
bool loadData(uint8_t *d, int size)
{
    QFile f("settings"); f.open(QIODevice::ReadOnly); 
    return f.read((char*)d, size)==size;
}

