// generates the pattern for star display...
static uint8_t const starPics0[]=
{ 0, 6, 5, 5, 5, 6, 0,
  6, 5, 4, 4, 4, 5, 6,
  5, 4, 3, 2, 3, 4, 5,
  5, 4, 2, 1, 2, 4, 5,
  5, 4, 3, 2, 3, 4, 5,
  6, 5, 4, 4, 4, 5, 6,
  0, 6, 5, 5, 5, 6, 0,
};
static void generateStarPatern()
{
    int posandsize[32*2];
    int pos= 0;
    qDebug() << "static uint8_t const starPatternsV[]={";
    for (int i=0; i<32; i++)
    {
        int radii= 0;
        uint8_t p[7*7]= {0}; 
        int toSpread= (i+1)*31;
        for (int j=1; j<=6; j++) 
        {
            radii= j;
            int cnt= 0; for (int k=0; k<49;k++) if (starPics0[k]==j) cnt++;
            int val= (toSpread+cnt+1)/cnt; if (val>31) val= 31;
            for (int k=0; k<49;k++) if (starPics0[k]==j) p[k]= val, toSpread-= val;
            if (toSpread<=0) break;
        }
        if (radii==1) radii=0;
        else if (radii<=3) radii=1;
        else if (radii<=4) radii=2;
        else radii=3;
        posandsize[i*2]= pos; posandsize[i*2+1]= radii*2+1; 
        QString s= "  "; for (int y=3-radii; y<=3+radii; y++) for (int x=3-radii; x<=3+radii; x++) s+= QString::number(p[y*7+x])+",", pos++;
        qDebug() << s;
    }
    qDebug() << "};";
    qDebug() << "static struct { uint8_t const *p, size; } const starPatterns[32]={";
    for (int i=0; i<32; i++) qDebug() << "  { starPatternsV+"+QString::number(posandsize[(31-i)*2])+", "+QString::number(posandsize[(31-i)*2+1])+"},";
    qDebug() << "};";
}


#include <iostream>
#include <fstream>
#include <sstream>
#include <vector>
#include <algorithm>
#include <Qfile>

struct TTStar { float ra, dec, dist, mag, absmag; char name[30]; int con, bayer; bool more; };
static int sortF(TTStar const &s1, TTStar const &s2) { return s1.dec>s2.dec; }
static char *tok(char *&s, bool &eol, bool &eof)
{
    eol= eof= false;
    while (true) if (*s==0) { eol= eof= true; return nullptr; } else if (*s=='\n') { s++; eol= true; return nullptr; } else if (*s<=' ') *s++; else break;
    char *t= s;
    while (true) if (*s==',') { *s++= 0; return t; } else if (*s==0) { eol= eof= true; return nullptr; } else if (*s=='\n') { eol= true; *s++=0; return t; } else *s++; 
}

int startConvert(char const *inFile, char const *outFile)
{
    QFile f1(inFile); f1.open(QIODevice::ReadOnly); QByteArray d= f1.readAll(); f1.close();
    char *s= d.data();
    struct { char name[10]; int index; } cols[8]= {{"proper"},{"ra"},{"dec"},{"dist"},{"mag"},{"absmag"},{"bayer"},{"con"}};
    std::vector<TTStar> star;
    bool eol, eof;
    for (int i=0; i<8; i++) cols[i].index= -1;
    while (true)
    {
        char *t= tok(s, eol, eof); if (eof) exit(0); if (eol) break;
        for (int i=0; i<8; i++) if (strcmp(t, cols[i].name)==0) { cols[i].index= i; break; }
    }
    for (int i=0; i<8; i++) if (cols[i].index==-1) { printf("error in input file, first row does not include all collumns proper, ra, dec, dist, mag, absmag, bayer, con\r\n"); exit(0); }
    while (true)
    {
        TTStar st= {-1, -1, -1, -100, -100, "", -1, -1, false };
        int col= 0;
        while (true)
        {
            char *t= tok(s, eol, eof); if (eof||eol) break;
            for (int i=0; i<8; i++)
                if (cols[i].index==col)
                {
                    if (i>=1 && i<=5) // numbers
                    {
                        float res= strtof(t, nullptr);
                        if (i==1) st.ra= res; else if (i==2) st.dec= res; else if (i==3) st.dist= res; else if (i==4) st.mag= res; else st.absmag= res;
                        break;
                    }
                    else if (i==0) { strncpy_s(st.name, t, 30); st.name[15]=0; if (st.name[0]!=0) st.more= true; break; }
                    else if (i==6)
                    {
                        char const greek[24][4]= {{"Alp"},{"Bet"},{"Chi"},{"Del"},{"Eps"},{"Eta"},{"Gam"},{"Iot"},{"Kap"},{"Lam"},{"Mu"},{"Nu"},{"Ome"},{"Omi"},{"Phi"},{"Pi"},{"Psi"},{"Rho"},{"Sig"},{"Tau"},{"The"},{"Ups"},{"Xi"},{"Zet"}};
                        for (int j=0; j<24; j++) if (strcmp(greek[j], t)==0) { st.bayer= j; st.more= true; break;}
                        break;
                    }
                    else  if (i==7)
                    {
                        char const cons[88][4]= {{"And"},{"Ant"},{"Aps"},{"Aql"},{"Aqr"},{"Ara"},{"Ari"},{"Aur"},{"Boo"},{"CMa"},{"CMi"},{"CVn"},{"Cae"},{"Cam"},{"Cap"},{"Car"},{"Cas"},{"Cen"},{"Cep"},{"Cet"},{"Cha"},{"Cir"},{"Cnc"},{"Col"},{"Com"},{"CrA"},{"CrB"},{"Crt"},{"Cru"},{"Crv"},{"Cyg"},{"Del"},{"Dor"},{"Dra"},{"Equ"},{"Eri"},{"For"},{"Gem"},{"Gru"},{"Her"},{"Hor"},{"Hya"},{"Hyi"},{"Ind"},{"LMi"},{"Lac"},{"Leo"},{"Lep"},{"Lib"},{"Lup"},{"Lyn"},{"Lyr"},{"Men"},{"Mic"},{"Mon"},{"Mus"},{"Nor"},{"Oct"},{"Oph"},{"Ori"},{"Pav"},{"Peg"},{"Per"},{"Phe"},{"Pic"},{"PsA"},{"Psc"},{"Pup"},{"Pyx"},{"Ret"},{"Scl"},{"Sco"},{"Sct"},{"Ser"},{"Sex"},{"Sge"},{"Sgr"},{"Tau"},{"Tel"},{"TrA"},{"Tri"},{"Tuc"},{"UMa"},{"UMi"},{"Vel"},{"Vir"},{"Vol"},{"Vul"}};
                        for (int j=0; j<88; j++) if (strcmp(cons[j], t)==0) { st.con= j; break;}
                        break;
                    }
                }
            col++;
        }
        if (st.ra!=-1 && st.dec!=-1) star.push_back(st);
        if (eof) break;
    }

    std::sort (star.begin(), star.end(), sortF);

    QFile f2(outFile); f2.open(QIODevice::WriteOnly); 
    char buf[2000];

    char const ttstar[]="uint32_t const nbStars= %d; // = %dkb\r\nTStar const stars[]={\r\n";
    sprintf(buf, ttstar, star.size(), (star.size()*6)/1024);
    f2.write(buf);
    for (int i=0; i<star.size(); i++)
    {
        TStar st; st.setRa(star[i].ra); st.setDec(star[i].dec); st.setMag(star[i].mag); st.hasMoreInfo= star[i].more;
        uint8_t const *t= (uint8_t const *)&st;
        sprintf(buf, "  { %d, %d, %d, %d, %d, %d },\r\n", t[0], t[1], t[2], t[3], t[4], t[5]); f2.write(buf);
        f2.write(buf);
    }
    f2.write("};\r\nuint8_t const starsMore[]={\r\n");
    int nbmore= 0, moresize= 0;
    for (int i=0; i<star.size(); i++)
        if (star[i].more)
        {
            nbmore++;
            TStarMore sm; sm.name= strlen(star[i].name); sm.setIndex(i); sm.setBayerGreek(star[i].bayer), sm.setBayerConst(star[i].con), sm.setDist(star[i].dist); sm.setAbsMag(star[i].absmag);
            { uint8_t *t= (uint8_t*)&sm; sprintf(buf, "  %d, %d, %d, %d, %d, %d,", t[0], t[1], t[2], t[3], t[4], t[5]); f2.write(buf); }
            char t[1000];
            moresize+= 6+strlen(star[i].name);
            for (int j=0; j<strlen(star[i].name); j++) { t[j*4+0]= '\''; t[j*4+1]= star[i].name[j]; t[j*4+2]= '\''; t[j*4+3]= ','; }
            t[strlen(star[i].name)*4]= 0; strcat_s(t, "\r\n");
            f2.write(t);
        }
    sprintf(buf, "};\r\nuint32_t const nbMoreStars=%d; //%dbytes\r\n", nbmore, moresize); f2.write(buf);
    return 1;
}
